create Procedure Trae_Reporte_Importacion_Gastos(@imp_codemp integer, @imp_impid integer, @idi_idid integer) as    SELECT view_gastos_importacion_despachos.imp_numero,              view_gastos_importacion_despachos.pcl_rut,              view_gastos_importacion_despachos.imp_nombre,              view_gastos_importacion_despachos.provcli,              view_gastos_importacion_despachos.tci_nombre,              view_gastos_importacion_despachos.cbc_numprovcli,              view_gastos_importacion_despachos.cbc_tipcambio,              view_gastos_importacion_despachos.pdt_codfisico,              view_gastos_importacion_despachos.pdt_nombre,              view_gastos_importacion_despachos.ins_nombre,              view_gastos_importacion_despachos.ins_codigo,              view_gastos_importacion_despachos.dcc_cantidad,              view_gastos_importacion_despachos.dcc_precio,              view_gastos_importacion_despachos.dcc_neto,              view_gastos_importacion_despachos.clb_tipcpbtdoc,              view_gastos_importacion_despachos.tipcpbt,              view_gastos_importacion_despachos.tco_agrupa,              view_gastos_importacion_despachos.tra_nombre,              view_gastos_importacion_despachos.pcl_nomfant,              view_gastos_importacion_despachos.dpc_numero,              view_gastos_importacion_despachos.tra_numero,              view_gastos_importacion_despachos.pcd_nombre,              view_gastos_importacion_despachos.reg_nombre,              view_gastos_importacion_despachos.com_nombre,             view_gastos_importacion_despachos.ciu_nombre        FROM view_gastos_importacion_despachos       WHERE ( view_gastos_importacion_despachos.imp_codemp = @imp_codemp ) AND             ( view_gastos_importacion_despachos.imp_impid = @imp_impid ) AND             ( view_gastos_importacion_despachos.idi_idid = @idi_idid ) AND             ( view_gastos_importacion_despachos.tci_idid = @idi_idid )   